import React from "react";
import ".././App.css";

class Timer extends React.Component {
  render() {
    return (
      <form>
        <h1>This page</h1>
        {
          <input
            onSubmit={ev => {
              ev.preventDefault();
              this.props.handleSetState("login");
            }}
            type="submit"
            value="Voltar"
          />
        }
      </form>
    );
  }
}

export default Timer;
